<table style=position:absolute;top:40px;left:0px;background:#a7fc00;border-collapse:collapse id=tileTable border=3>
<tr><td align=center colspan=3>Click on Tile Unit to load it</td></tr>

</table>

<script>
var Code
//---clicl on tessellate image---
function getTile(tileCode)
{
   Code=tileCode
  parent.TUCode=Code

run_XMLHttpRequest()
}




//---get svg file as xml, and place its elements in local 'empty' svg(tileUnitSVG)---
//--fired from---
function run_XMLHttpRequest()
{
   var loadXML = new XMLHttpRequest;
   FoundFile=true
    function handler()
    {
        if(loadXML.readyState == 4)
        {
            if (loadXML.status == 200) //---loaded ok---
            {
                //---
                parent.PreviewTileString=loadXML.responseText  //---drawTessellate.js
                   // console.log(loadXML.responseText)
                   parent.closeTessellatePreview()
                  parent.openAddTessellateDraw()
                    //---open---addElementTessellate.htm--
            }

        }
    }

    if (loadXML != null)
    {
        loadXML.open("GET", "../../../SVGTiles/"+Code+".svg", true);
        loadXML.onreadystatechange = handler;
        loadXML.send();
    }

}
//---onload---
function buildTileTable()
{
     var rowCnt=2
     //var keepPNG=""
     for(var k=0;k<refArray.length;k++)
     {
         var ref=refArray[k]
         if(ref)
         {
             var galleryFile="../../../Gallery/"+ref[0]+".png"
             var svgFile="../../../SVGTiles/"+ref[1]+".svg"
                         var keep=ref[0]+".png"
                //keepPNG+="keepPNG["+(rowCnt-2)+"]='"+keep+"'\n"
            var row=tileTable.insertRow(rowCnt++)
             var cntCell=row.insertCell(0).innerHTML="<b>"+(rowCnt-2)+"</b>"


               var svgCell=row.insertCell(1)
               svgCell.align="center"


               svgCell.innerHTML='<img style="cursor:pointer" title="Load this tesselation structural unit" onClick=getTile("'+ref[1]+'");this.style.borderWidth="3px";this.style.borderColor="violet";this.style.borderStyle="solid" class=imgTu src="'+svgFile+'" width=160 height=160 />'

                               var imgCell=row.insertCell(2).innerHTML="<img title='"+ref[0]+" "+ref[0]+"'  width=160 height=160 src="+galleryFile+" />"




                }

        }
         // parent.myValue.value=keepPNG
}

function showHidePatternButtonClicked()
{
   if(tileTable.style.visibility=="visible")
   {
      tileTable.style.visibility="hidden"
       showHidePatternButton.innerHTML="Show Table"

   }
   else
   {
      tileTable.style.visibility="visible"
       showHidePatternButton.innerHTML="Hide Table"

   }




}
